import React from 'react'
import Particles from 'react-particles-js';

const bannerRight = () => {
  return (
    <div className="header-right">
      <Particles
        params={{
          polygon: {
            enable: true,
            type: 'inside',
            move: {
              radius: 10
            },
            url: 'path/to/svg.svg'
          }
        }} />
    </div>
  )
}

export default bannerRight;
